import { useEffect } from "react";

export const setUseEffect = () => {
  useEffect(() => {
    // Returns the cleanup function
    return () =>{
      const metaTag = document.querySelector(`link[rel="icon"]`);
      if (metaTag) {
        console.log(metaTag);
        metaTag.remove();
      }
    }
  })
}
